    return (<>

        <div className='timeline-heading'>
            <h2>Holidays</h2>
        </div>
        <div className='vertical-timeline'>
            <ul>
                {
                    date.map((data) => (
                        <li key={data.id} >
                            <h5>{data.d}</h5>
                        </li>
                    ))
                }
                <li>

                </li>
            </ul>
        </div>
        
        </>);
};

export default Timeline;
